import React from 'react'
// import './ExpenseItem.css'

function ExpenseItem() {
  return (
    <div className='expense-item'>
      <div>September 29th 2022</div>
      <div className='expense-item_decsription'>
        <h2>Car Insurance</h2>
      </div>
      <div className='expense-item_price'>$278.5</div>
    </div>
  )
}

export default ExpenseItem
